function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <Carrucel/>
          <Titulo />
          <Navbar />
        </header>

        <main>
          <Routes>
            <Route path="/" element={<div>Inicio</div>} />
            <Route path="/acerca" element={<Acerca />} />
            <Route path="/catalogo" element={<Catalogo />} />

            <Route path="/login" element={<Login />} />
          </Routes>
        </main>

        <ChatBotComponent />  {/* Aqu√≠ usas tu chatbot */}
      </div>
    </Router>
  );
}

export default App;
